import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import { samples } from "../utils/constants";
const Samples = () => {
  return (
    <Wrapper>
      <h2 className="sampletitle">Oxsar Mehsullar</h2>
      <div className="products-container">
        {samples.map((pr) => {
          return (
            <div className="cont">
              <div className="container">
                <Link to="">
                  <img src={pr.img} alt={pr.title} className="sampleimg" />
                </Link>
              </div>
              <footer>
                <h5>{pr.title}</h5>
                <p>{pr.price}</p>
              </footer>
            </div>
          );
        })}
      </div>
    </Wrapper>
  );
};

const Wrapper = styled.div`

background: gren;
.products-container{
    width: 90%;
      margin: auto;
      background: red;
      display: flex;
}
       
.sampletitle {
    font-style: normal;
font-weight: 500;
font-size: 34px;
line-height: 53px;
color: var(--black);
text-align: center;
margin-top: 15px;
  }
  h5 {
    margin-top: 3px;
  }
`;

export default Samples;
